import '../css/Header.css';
import {Link} from "react-router-dom";
import {io} from 'socket.io-client'


const Header = ({socket, num}) => {
    console.log(num)

    const handleOnClick = () => {
        socket.disconnect()
        // console.log(socket.id)
    }

    return (
        <div className='Header'>
            <Link id='headerLink' to='/' onClick={handleOnClick}> WORDLE WITH FRIENDS </Link>
        </div>
    );
}

export default Header;
